import React from 'react';
import Header from './Header/Header.jsx'
import BinarySearchTree from './Trees/BinarySearchTree.jsx'
import './TreeVisualizer.css';


export default class TreeVisualizer extends React.Component {
    constructor(props) {
        super(props);
        
        this.state = {
            header: new Header(),
            tree: new BinarySearchTree()           
        };

        this.reset();
    }

    render() {
        return this.state.tree.createDOM();
    }

    componentDidMount() {
    }

    initialize() {
        this.state.tree.initialize();
    }
}
